import React from 'react';
import BasePage from '../BasePage';

const ClaimTestingPage = () => {
    return (
        <BasePage>
            <section className="py-20 bg-gradient-to-br from-primary-50/30 to-primary-100/30">
                <div className="container mx-auto px-4 sm:px-6 lg:px-8">
                    <div className="text-center max-w-4xl mx-auto">
                        <p className="text-primary-500 text-sm font-medium uppercase tracking-wide mb-4 font-sans">
                            Solutions - By Use Case
                        </p>
                        <h1 className="text-4xl sm:text-5xl md:text-6xl font-display font-semibold text-gray-800 leading-tight mb-6">
                            Claim Testing
                        </h1>
                        <p className="text-xl text-gray-500 max-w-3xl mx-auto leading-relaxed font-sans">
                            Validate claims with comprehensive insights and ensure your messaging resonates with your target audience.
                        </p>
                        <div className="mt-8">
                            <button className="bg-primary-500 hover:bg-primary-600 text-white px-8 py-4 rounded-lg font-display font-medium transition-all duration-200 shadow-sm hover:shadow-md">
                                Learn more about the solution
                            </button>
                        </div>
                    </div>
                </div>
            </section>
        </BasePage>
    );
};

export default ClaimTestingPage;
